;; **
;;; # Finding and drawing contours
;;; 
;;; Finding shapes and object is one of the key reason people usually comes to OpenCV.
;;; 
;; **

;; @@
(ns lush-storm
  (:require
    [opencv3.utils :as u]
    [opencv3.colors.html :as color]
    [opencv3.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## Finding contour of headphone and drawing rectangles ...
;; **

;; @@
(def headphones 
  (imread "resources/morph/headphone.png"))

(def image-c 
  (clone headphones))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;lush-storm/image-c</span>","value":"#'lush-storm/image-c"}
;; <=

;; @@
(def contours 
  (new-arraylist))

(find-contours 
  (-> headphones clone (cvt-color! COLOR_BGR2GRAY)) 
  contours 
  (new-mat) 
  RETR_TREE CHAIN_APPROX_SIMPLE)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def interesting-contours 
  (filter 
    #(and (> (contour-area %) 100 ) (> (.height (bounding-rect %)) 28)) 
    contours))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;lush-storm/interesting-contours</span>","value":"#'lush-storm/interesting-contours"}
;; <=

;; @@
(doseq [c interesting-contours]
    (let [ rect (bounding-rect c)]
      (rectangle
        image-c
        (new-point (.x rect) (.y rect))
        (new-point (+ (.width rect) (.x rect)) (+ (.y rect) (.height rect)))
        (color/->scalar "#ccffcc")
        2)))

(u/mat-view image-c)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"510\" height=\"316\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x141a4961 \"BufferedImage@141a4961: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 510 height = 316 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Using core draw-contours to ... draw the contours
;; **

;; @@
(def image-c (clone headphones))

(dotimes [ci (.size contours)]
 (draw-contours image-c contours ci (color/->scalar "#ccffcc") 2))

(u/mat-view image-c)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"510\" height=\"316\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1a392e \"BufferedImage@1a392e: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 510 height = 316 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def image-d (clone headphones))

(doseq [c interesting-contours]
 (let [ rect (bounding-rect c) center (u/center-of-rect rect) ]
   (circle image-d  
           center
           (u/distance-of-two-points center (.tl rect)) 
           (color/->scalar "#ccffcc") 
           2)))


(u/mat-view image-d)
